import React from "react";
import ExpencseDes from "../main/components/ExpencseDes";

const Expence = () => {
  return (
    <div>
      <div className="bg-[#F6F7F9] flex justify-evenly mt-24 h-[426px] relative">
        <div className="flex flex-col mr-20 relative">
          <h1 className="text-[ADB3BE] contrast-50 font-semibold text-sm mt-24">
            SAVE TIME AND MONEY
          </h1>
          <p className="text-[#050F4E] text-4xl mt-4">
            Find My Trials reduce expences, accelerate <br />
            research, and yield quicker advancements, <br />
            ultimately saving both time and money.
          </p>
        </div>
        <div className="mt-24">
          <img src="images/Group.png" alt="group" />
        </div>
        <div className="mt-24">
          <img src="images/Group1.png" alt="group" />
        </div>
      </div>
      <div className=" absolute top-60 mt-12">
        <ExpencseDes />
      </div>
    </div>
  );
};

export default Expence;
